import './Login-Regis.css';
const LoginRegis_RightSide = () => {
    return (
        <div className='LoginRegis_RightSide'>
            <h2>----- Order Quick, Enjoy More</h2>
            <h1>Delicious</h1>
            <h1>Made Simple</h1>
            <h3>Great meals, minimal time. Enjoy without wait</h3>
        </div>
    )
}

export default LoginRegis_RightSide;
